import './outlinedButton.scss';
import PropTypes from 'prop-types';

const OutlinedButton = ({text, backgroundColor, ...props}) => {
    return(
        <div>
            <label className='outlined_btn'>
                {text}
            </label>
        </div>

    )
}

export default OutlinedButton;
